// convertDate Funtion to change ANSI/EDIFACT Dates into NetSuite Importable Dates  
function convertDate(date) {
  var year = date.slice(0, 4);
  var month = date.slice(4, 6);
  var day = date.slice(6, 8);
  return `${month}/${day}/${year}`;
} 